import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import * as serviceWorker from "./serviceWorker";
import "bootstrap/dist/css/bootstrap.css";
import Navigation from "./components/navigation";
import Searchbar from "./components/searchbar";
import asemat from "./asemat";
import Datatable from "./components/datatable";

export function showData(d) {
  var text = `Päivän ${new Date(1531353600000).getDay()}.
  ${new Date(1531353600000).getMonth()}.
  ${new Date(1531353600000).getFullYear()} 
  max-lämpötila oli {d.locations[0].data.tmax.timeValuePairs[0].value}`;

  var elem1 = React.createElement(
    "h1",
    {
      key: d.locations[0].info.id,
    },
    text
  );
  console.log(Datatable.props.elements);
  // Datatable.setState({ dataelements: [elem1] });
}
export function returnStations(str) {
  var matchList = [];
  var searchRegex = new RegExp(str, "i");
  if (str.length > 1) {
    asemat.forEach((value, index) => {
      if (searchRegex.test(value[0])) {
        matchList.push(value);
      }
    });
    return matchList;
  } else {
    asemat.forEach((value, index) => {
      matchList.push(value);
    });
    return matchList;
  }
}

ReactDOM.render(
  <React.StrictMode>
    <Navigation />
    <Searchbar />
    <Datatable elements={[]} />
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
